function ToBeCycMat(tuple1, tuple2, tuple3)
    x1,y1,z1,c1,cp1,t1,m1,p1 = tuple1
    x2,y2,z2,c2,cp2,t2,m2,p2 = tuple2
    x3,y3,z3,c3,cp3,t3,m3,p3 = tuple3
    return kron(RandXYZ(Array{Int}([x1,y1,z1,x2,y2,z2,x3,y3,z3])),RandPT(Array{Int}([c1,c2,c3,cp1,cp2,cp3,t1,t2,t3,m1,m2,m3,p1,p2,p3])))
end



function diff3Cocycle(XYZtuple4, PTtuple4, PC3tuple4)
    x1,y1,z1,x2,y2,z2,x3,y3,z3,x4,y4,z4 = XYZtuple4
    c1,cp1,m1,p1,c2,cp2,m2,p2,c3,cp3,m3,p3,c4,cp4,m4,p4 = PTtuple4
    t1,t2,t3,t4 = PC3tuple4
    
    return ToBeCycMat(Array{Int}([x2,y2,z2,c2,cp2,t2,m2,p2]),Array{Int}([x3,y3,z3,c3,cp3,t3,m3,p3]),Array{Int}([x4,y4,z4,c4,cp4,t4,m4,p4]))+
        ToBeCycMat(Array{Int}([x1,y1,z1,c1,cp1,t1,m1,p1]),Array{Int}([x2,y2,z2,c2,cp2,t2,m2,p2]),sg223productg1g2(Array{Int}([x3,y3,z3,c3,cp3,t3,m3,p3]),Array{Int}([x4,y4,z4,c4,cp4,t4,m4,p4])))+
        ToBeCycMat(Array{Int}([x1,y1,z1,c1,cp1,t1,m1,p1]),sg223productg1g2(Array{Int}([x2,y2,z2,c2,cp2,t2,m2,p2]),Array{Int}([x3,y3,z3,c3,cp3,t3,m3,p3])),Array{Int}([x4,y4,z4,c4,cp4,t4,m4,p4]))+
        ToBeCycMat(sg223productg1g2(Array{Int}([x1,y1,z1,c1,cp1,t1,m1,p1]),Array{Int}([x2,y2,z2,c2,cp2,t2,m2,p2])),Array{Int}([x3,y3,z3,c3,cp3,t3,m3,p3]),Array{Int}([x4,y4,z4,c4,cp4,t4,m4,p4]))+
        ToBeCycMat(Array{Int}([x1,y1,z1,c1,cp1,t1,m1,p1]),Array{Int}([x2,y2,z2,c2,cp2,t2,m2,p2]),Array{Int}([x3,y3,z3,c3,cp3,t3,m3,p3]))
end

function randdiffGen()
    return diff3Cocycle(rand([0,1], 12), rand([0,1], 16), rand([0,1,2], 4))
end



